import Link from 'next/link';
import styles from './Header.module.css'



const linkStyle = {
  marginRight: 30
  
  
};



const Header = () => (
  <div className={styles.header}>
    <h1 className={styles.tittle}>PI</h1>
    <div className={styles.op}>


    <customDropdown
buttonProps={{
  color: "red"
}}>
  
    <Link className="linkc" href="/">
      <a style={linkStyle}>Home</a>
    </Link>
</customDropdown>
    <Link  className="linkc" href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    </div>
  </div>
);


export default Header;
